	let _canvasStore;
	console.log('【ScreenshotWorkerRender】: Thread has been started ');

	/**
	 * 检测是否白屏
	 * @param ctx 
	 * @param x 
	 * @param y 
	 * @param w 
	 * @param h 
	 * @returns 
	 */
	const detectWhiteScreenWithPixel = data => {
		try {
		 const colorSet = new Set(data);
		 const colorArr = Array.from(colorSet);
		 if (colorArr.length === 1) {
			if (colorArr[0] === 0) {
				return true;
			}
		 }
		 return false;
		} catch (e) {
			console.log('【ScreenshotWorkerRender】screenSnapshot detectWhiteScreenWithPixel occur an error ==>', e);
			return false;
		}
	}

	const evtFunc = msg => {

		if (msg.data.name === 'init') {
			initRendererCanvas(msg.data);
		}
		if (msg.data.name === 'capture') {
			offScreenRender(msg.data)
		}
	}

	self.addEventListener('message', evtFunc, false);


	const initRendererCanvas = data => {
		const { parameters = {} } = data;
		const	{ canvas } = parameters;
		if (!_canvasStore) {
			_canvasStore = canvas;
		}
	};

	const offScreenRender = data => {
		try {
			const endTimestamp = new Date().getTime();
			const { parameters } = data;
			const { imageData, pixelRatio, step, timestamp } = parameters;

			const canvas = new OffscreenCanvas(_canvasStore.width, _canvasStore.height);

			const ctx = canvas.getContext('2d');
			if (!ctx) {
				console.warn('【ScreenshotWorkerRender】: Please provide canvas element params ');
				return;
			}

			console.log('【ScreenshotWorkerRender】screenSnapshot receive captured cmd use time ==>', endTimestamp - timestamp);
			let snapshotImage = { image: '', width: 0, height: 0, step: step }; 

			ctx?.restore();
			ctx?.clearRect(0, 0, canvas.width, canvas.height);
			self.createImageBitmap(imageData).then(source => {
			ctx?.translate(0, canvas.height);
			ctx?.scale(1, -1);
			ctx?.drawImage(source, 0, 0);
			ctx?.restore();
			canvas[canvas.convertToBlob ? 'convertToBlob' : 'toBlob']().then(blob => {
					const isWhiteScreen = detectWhiteScreenWithPixel(imageData.data);
					console.log('【ScreenshotWorkerRender】screenSnapshot captured a white picture ==>', isWhiteScreen);
					if (!isWhiteScreen) {
						const image = new FileReaderSync().readAsDataURL(blob);
						const styleWidth = canvas.width / pixelRatio;
						const styleHeight = canvas.height / pixelRatio;
						snapshotImage =	{ image: image, width: styleWidth, height: styleHeight, step: step }; 
					}
					self.postMessage({ name: 'update', snapshotImage: snapshotImage });
				});
			});
	} catch (e) {
		console.log('【ScreenshotWorkerRender】screenSnapshot offScreenRender occur an error ==>', e);
